const state = {
  index: 0,
  isPlaying: false,
  currentTime: 0,
  duration: 0,

  // four mode available => main,next,my-song,shuffle
  playMode: "main",

  songs: [
    {
      name: "the cooler guard",
      author: "Mine the way",
      img: "1.jpg",
      music: "1.mp3",
      index: 1,
    },
    {
      name: "the wonder galaxy",
      author: "Zero to Zero->Infinity",
      img: "2.jpg",
